scroll_y = 0

player = {
    x = 135,
    y = 0,
    speedX = .05,
    vx = 0
}

settings = {
    bb = false,
    high_score = pmem(2),
    tutorial = true,
    music = true,
    sound = true
}

Stage = {}

function Stage:new(o)
    o = o or {}
    setmetatable(o, {
        __index = self
    })
    return o
end

function Stage:init()
end
function Stage:update(dt)
end
function Stage:quit()
end

function Positioner(total, initial)
    initial = initial or 1
    local pos = initial
    return {
        add = function()
            pos = pos + 1
        end,
        sub = function()
            pos = pos - 1
        end,
        pos = function()
            return ((pos - 1) % total) + 1
        end
    }
end

function cartMoves()

    if btn(0) then -- up
        -- if player.vy >= -3 then
        --    player.vy = player.vy - player.speedY
        -- end
    elseif btn(1) then -- down
        -- if player.vy <= 1 then
        --    player.vy = player.vy + player.speedY
        -- end
    else -- stop
        if player.vy > 0 then
            player.vy = player.vy - .05
            if player.vy < 0 then
                player.vy = 0
            end
        elseif player.vy < 0 then
            player.vy = player.vy + .05
            if player.vy > 0 then
                player.vy = 0
            end
        end
    end

    player.y = player.y + player.vy

    if btn(2) then -- left
        if player.vx >= -1 then
            player.vx = player.vx - player.speedX
        end
    elseif btn(3) then -- right
        if player.vx <= 1 then
            player.vx = player.vx + player.speedX
        end
    else -- stop
        if player.vx > 0 then
            player.vx = player.vx - .05
            if player.vx < 0 then
                player.vx = 0
            end
        elseif player.vx < 0 then
            player.vx = player.vx + .05
            if player.vx > 0 then
                player.vx = 0
            end
        end
    end

    player.x = player.x + player.vx
end

function cartsLimits()
    if player.y < 0 then
        player.y = 0
    end
    if player.y > 120 then
        player.y = 120
    end
    if player.x < 31 then
        player.x = 31
    end
    if player.x > 194 then
        player.x = 194
    end
end

function StageManager()

    local stages = {}
    local actual_stage = {
        instance = Stage:new()
    }

    return {
        add = function(name, stage)
            stages[name] = {
                name = name,
                proto = stage,
                instance = nil
            }
        end,
        switch = function(name, keep_instance)
            keep_instance = keep_instance or false
            local new_stage = stages[name]

            if new_stage == nil then
                return
            end
            if actual_stage.name == name then
                return
            end

            actual_stage.instance:quit()
            if not keep_instance then
                actual_stage.instance = nil
            end

            if new_stage.instance == nil then
                new_stage.instance = new_stage.proto:new()
                new_stage.instance:init()
            end

            actual_stage = new_stage
            if name == "menu" then
                music(1)
            elseif name == "game" then
                music(0)
            end
        end,
        update = function(dt)
            actual_stage.instance:update(dt)
        end
    }
end

Menu = Stage:new{
    p = nil
}

function Menu:init()
    self.p = Positioner(2)
end

function Menu:update(dt)
    cls(0)
    map(210, 119, 30, 17)
    local y = 64
    print("Start", 90, y)
    print("Settings", 90, y + 10)
    spr(98, 80, (self.p.pos() - 1) * 10 + y - 2)

    if btnp(0) then
        self.p.sub()
    elseif btnp(1) then
        self.p.add()
    elseif btnp(4) or btnp(5) then
        if self.p.pos() == 1 then
            sm.switch("game")
        elseif self.p.pos() == 2 then
            sm.switch("settings")
        end
    end
end

Game = Stage:new()

function Game:init()
    player.x = 138
    player.y = 115
    player.vx = 0
    player.vy = 0
    self.road_vy = -.15
    self.road_pos = 0
end

function Game:update(dt)
    cls()
    self:draw_road()
    self:update_road(dt)
    -- map(0, scroll_y // 8, 30, 17, 0, (scroll_y % 8) - 8)
    -- map(0, (scroll_y // 8) + 1, 30, 17, 0, (scroll_y % 8) + 8)
    spr(0, player.x, player.y, 0, 1, 0, 0, 2, 2)
    cartMoves()
    cartsLimits()
end

function Game:draw_road()
    local pos = math.floor(self.road_pos)
    local tmp = pos % 240

    if tmp > 119 then
        map(0, 0, 30, 17, 0, -(tmp - 120))
        map(30, 0, 30, 17, 0, -(tmp - 240))
        map(0, 0, 30, 17, 0, -(tmp - 360))
    else
        map(30, 0, 30, 17, 0, -tmp)
        map(0, 0, 30, 17, 0, -(tmp - 120))
        map(30, 0, 30, 17, 0, -(tmp - 240))
    end
end

function Game:update_road(dt)
    if self.state == "game" then
        self.road_vy = self.road_vy - 0.000001 * dt
    end

    if self.state ~= "game over" then
        self.road_pos = self.road_pos + self.road_vy * dt
    end

    if self.state == "game" then
        self.distance = 0.1406 * self.road_pos

        if self.distance > settings.high_score then
            settings.high_score = self.distance
        end
    end
end

sm = StageManager()
sm.add("menu", Menu)
sm.add("game", Game)
sm.switch("menu")

last_t = time()
function TIC()
    local actual_t = time()
    local dt = actual_t - last_t

    cls()

    scroll_y = scroll_y + 0.6
    if dt < 500 then
        sm.update(dt)
    end

    last_t = actual_t
end

